          <h1>Umjerenost je cool</h1>
          <h4>Odgovorna konzumacija alkohola je cool, ugrožavati sebe i druge nije cool. </h4>
          <p>
            Doprinos boljem svijetu možeš dati i kroz odgovorno ponašanje prema sebi, bližnjima i društvu. Svojim cool ponašanjem budi primjer drugima te tako pomozi u rješavanju problema vožnje pod utjecajem alkohola, maloljetničke konzumacije alkohola, pretjerane konzumacije te konzumacije tijekom trudnoće. 
