          <h4>Svatko od nas neodvojivi je član društva i naše individualno ponašanje odražava se na društvo u cjelini.</h4>
          <p>
            Svoj doprinos boljem svijetu možeš dati kroz brigu o ranjivim i marginaliziranim članovima društva, kroz uključivost, poštivanje raznolikosti i podršku lokalnoj sredini. 
